import './subscribeStyle.css';

export const Subscribe = () => {
    return (
        <div className='subscribe-container'>
            <h3>JOIN OUR MAILING LIST</h3>
            <form className='subscribe'>
                <input type='text' placeholder='enter email address'/>
                <button>JOIN</button>
            </form>
        </div>
    );
};
